import React from 'react';
import logo from './logo.svg';
import './scss/master.scss';

function App() {
  return (
    <div className="App">
      <img src={logo} className="App-logo" alt="logo" />
      <header className="App-header">
        <p>Enter text here!</p>
      </header>
    </div>
  );
}

export default App;
